import React from 'react'
import { Helmet } from "react-helmet";
const Shop =()=>{
    const cardArr = [
        {
            id: 1,
            text: "Hey this is a test.",
            img: " ",
            like: 0
        },
        {
            id: 2,
            text: "If this works I'll call it a day.",
            img: " ",
            like: 0
        },
        {
            id: 3,
            text: "I'll drink a lot of beer.",
            img: " ",
            like: 0
        },
        {
            id: 4,
            text: "Cheers",
            img: " ",
            like: 0
        
        }]
    return(
        <>
          <Helmet>
             <title>Arizona Resources - Acclaimed Home Warranty : Acclaimed Home Warranty</title>
             <meta name="description" content="Arizona Resources - Acclaimed Home Warranty" />
          </Helmet>
        <div>
            <h1>Shop</h1>
            {/* <SingleSquare/> */}
            {/* <SingleConstruction/> */}
            {/* <CondoPlans/> */}
            {/* <DuplexPlans/> */}
            {/* <TriplexPlans/> */}
            {/* <FourplexPlans/> */}
            {/* <ApplicationInformation/> */}
        </div>
        </>
    )
}
export default Shop;
